script: |
  super -f text -I q9095.spq | sort > q9095.out

inputs:
  - name: q9095.spq
    data: |
      SELECT col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 IN ( col0, col1 + - col0 - - - col2 * + + col1 );
  - name: tab1

outputs:
  - name: q9095.out
    data: |
      59
      68
      96
